import './App.css';
import Footer from './Components/Footer/Footer';
import { Header } from './Components/Header/Header';
import { HomePage } from './Pages/HomePage/HomePage';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">

      <BrowserRouter>
        <Header />
        <HomePage />
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
